const Babysitters = ({babysitters}) => {

    return (
        <div>
            {babysitters.map(baby => 
                <ul>
                    <li key={baby.id}><b>{baby.last_name}, </b>
                        Name: </li>

                </ul>
                )}
        </div>
    )


}

export default Babysitters
